import React, { useState, useEffect } from 'react';
import { Plus, Edit2 } from 'lucide-react';
import { Button } from '../components/ui/Button'; // Custom Button Component
import { Dialog, DialogContent, DialogHeader, DialogTitle } from '../components/ui/Dialog'; // Custom Dialog Components
import { Table, TableHeader, TableRow, TableHead, TableBody, TableCell } from '../components/ui/Table'; // Custom Table Components
import { TicketForm } from './TicketForm'; // Custom Ticket Form Component

const API_BASE_URL = 'http://localhost:5000/api';

const TicketsManagement = () => {
  const [tickets, setTickets] = useState([]);
  const [selectedTicket, setSelectedTicket] = useState(null);
  const [isDialogOpen, setIsDialogOpen] = useState(false);

  useEffect(() => {
    fetchTickets();
  }, []);

  const fetchTickets = () => {
    fetch(`${API_BASE_URL}/tickets`)
      .then((res) => res.json())
      .then((data) => setTickets(data))
      .catch((err) => console.error('Error fetching tickets:', err));
  };

  const handleCreateTicket = (data) => {
    fetch(`${API_BASE_URL}/tickets`, {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify(data),
    })
      .then(() => {
        fetchTickets();
        setIsDialogOpen(false);
      })
      .catch((err) => console.error('Error creating ticket:', err));
  };

  const handleUpdateTicket = (data) => {
    fetch(`${API_BASE_URL}/tickets/${selectedTicket.ticket_id}`, {
      method: 'PUT',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify(data),
    })
      .then(() => {
        fetchTickets();
        setIsDialogOpen(false);
        setSelectedTicket(null);
      })
      .catch((err) => console.error('Error updating ticket:', err));
  };

  return (
    <div className="p-4">
      <div className="flex justify-between items-center mb-4">
        <h2 className="text-2xl font-bold">Tickets</h2>
        <Button
          onClick={() => {
            setSelectedTicket(null);
            setIsDialogOpen(true);
          }}
        >
          <Plus className="h-4 w-4 mr-2" />
          Add Ticket
        </Button>
      </div>

      <Dialog open={isDialogOpen} onOpenChange={setIsDialogOpen}>
        <DialogContent>
          <DialogHeader>
            <DialogTitle>{selectedTicket ? 'Edit Ticket' : 'Add Ticket'}</DialogTitle>
          </DialogHeader>
          <TicketForm
            ticket={selectedTicket}
            onSubmit={selectedTicket ? handleUpdateTicket : handleCreateTicket}
            onClose={() => setIsDialogOpen(false)}
          />
        </DialogContent>
      </Dialog>

      <Table>
        <TableHeader>
          <TableRow>
            <TableHead>Subject</TableHead>
            <TableHead>Description</TableHead>
            <TableHead>Status</TableHead>
            <TableHead>Customer ID</TableHead>
            <TableHead>Actions</TableHead>
          </TableRow>
        </TableHeader>
        <TableBody>
          {tickets.map((ticket) => (
            <TableRow key={ticket.ticket_id}>
              <TableCell>{ticket.subject}</TableCell>
              <TableCell>{ticket.description}</TableCell>
              <TableCell>{ticket.status}</TableCell>
              <TableCell>{ticket.customer_id}</TableCell>
              <TableCell>
                <Button
                  variant="outline"
                  size="sm"
                  onClick={() => {
                    setSelectedTicket(ticket);
                    setIsDialogOpen(true);
                  }}
                >
                  <Edit2 className="h-4 w-4" />
                </Button>
              </TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </div>
  );
};

export default TicketsManagement;
